import * as React from 'react';
import { Box, Flex, Link, Heading } from '@chakra-ui/react';
import { Link as RouterLink } from 'react-router-dom';

const Navigation = () => {
  return (
    <Flex bg="blue.500" p={4} color="white">
      <Heading size="md" mr={8}>Trading Novice</Heading>
      <Box mr={4}>
        <Link as={RouterLink} to="/fundamentals">Fundamentals</Link>
      </Box>
      <Box>
        <Link as={RouterLink} to="/simulator">Simulator</Link>
      </Box>
    </Flex>
  );
};

export default Navigation;
